import React from "react";
import "./Header.css";
import Notifications from "../../Assets/NavBarIcons/notification (1) 1.svg";
import settings from "../../Assets/NavBarIcons/setting (3) 1.svg";
import logout from "../../Assets/NavBarIcons/logout 1.svg";

const Header = ({ fullName, role, imageUrl }) => {
  return (
    <div className="Header">
      <div className="NavBar">
        <div className="icons">
          <img src={settings} alt="settings"></img>
          <img src={Notifications} alt="notifications"></img>
        </div>

        <div className="card">
          <div
            className="avatar"
            style={{ backgroundImage: `url(${imageUrl})` }}
          ></div>

          <div className="content">
            <h2 className="name">Full Name</h2>
            <p className="role">Role</p>
          </div>
        </div>

        <div className="Logout-icon">
          <img src={logout} alt="logout"></img>
        </div>
      </div>
    </div>
  );
};

export default Header;
